import React from 'react'
import DeleteOutlineIcon from '@material-ui/icons/DeleteOutline';

const Note = (props) => {
  return (
  <>
     <div className="note">
     <h1>{props.title}</h1>
        <br />
        <p>{props.content}</p>
        <button className="btn" onClick={props.deleteItem}>
           <DeleteOutlineIcon className="deleteIcon"/>
        </button>
     </div>
  </>
  )
}
export default Note;
